window.bookSummaryJSON = "<p>Did you know that tarot used to be a game played by royals that was lost to time? It was later unburied and eventually shifted to being one of the most popular forms of divination, untouched for decades. Shelly O’Bryan’s&nbsp;<i>Tarot Reading for Dummies</i>&nbsp;includes not only a crash course history of tarot reading but also everything a beginner could possibly need to learn to read tarot cards. Even if you're a different skill level, from novice to absolute expert, you can still find additional information and a handy layout for interpretations with&nbsp;this audiobook....</p> <p>In this audiobook you'll learn:</p> <p></p> <ul> <li>What is tarot?</li> <li>Breakdown of the major and minor arcana</li> <li>Spiritual and divinatory meanings of the major arcana, so the cards can be used both for reading the future and as a tool for self-reflection</li> <li>An explanation of the numerical pip cards of the minor arcana using the framework of numerology</li> <li>Simple techniques for reading tarot</li> <li>How to choose your first deck and clear energies</li> <li>The history of tarot</li> <li>A thorough explanation of how to read the cards for divination using the context of the question</li> <li>Practice spreads and sample readings</li> <li>Further resources to help you develop your new skills</li> </ul> <p><i>And so much more!</i></p> <p>In this audiobook, you'll discover how to create a connection to the tarot and develop your skills of intuition as you work with the cards. It’s this connection that you'll rely upon to form your own opinions and explanations of the readings you provide for yourself and others....</p> <p>Get your copy of <i>Tarot Reading for Dummies</i> today!</p>"; 
